		var upperline = new lib.upperLine();
		var beginingbackground = new lib.beginingBG();
		stage.addChild(beginingbackground);
		stage.addChild(upperline);
		
		///כפתור עצור מוזיקה////
		beginingbackground.stopSound.addEventListener("click", stopmusic);
		
		
		//הוספת הקומבו לבמה
		var forcombo = new lib.forcomb();
		forcombo.x = (stageW / 2);
		forcombo.y = 360;
		stage.addChild(forcombo);
		
